import { useState, useEffect } from "react";
import { FaEthereum, FaBitcoin } from "react-icons/fa";
import { formatDistanceToNow } from "date-fns";

const whaleWallets = {
  // Adrese Ethereum
  "0x742d35Cc6634C0532925a3b844Bc454e4438f44e": "Binance",
  "0x5a52E96BAcdaBb82fd05763E25335261B270Efcb": "Binance 2",
  "0x3f5CE5FBFe3E9af3971dD833D26bA9b5C936f0bE": "Binance 3",
  "0x28C6c06298d514Db089934071355E5743bf21d60": "Binance 4",
  "0x21a31Ee1afC51d94C2eFcCAa2092aD1028285549": "Binance 5",
  "0xdfd5293d8e347dfe59e90efd55b2956a1343963d": "Binance 6",
  "0x56Eddb7aa87536c09CCc2793473599fD21A8b17F": "Bitfinex",
  "0x9696f59E4d72E237BE84fFD425DCaD154Bf96976": "Bitfinex 2",
  "0x4Fabb145d64652a948d72533023f6E7A623C7C53": "Bitfinex 3",
  "0x876EabF441B2EE5B5b0554Fd502a8E0600950cFa": "Bitfinex 4",
  "0x77134cbc06cb00b66f4c7e623d5fdbf6777635ec": "Bitfinex 5",
  "0x6cC5F688a315f3dC28A7781717a9A798a59fDA7b": "OKX",
  "0xE92d1A43df510F82C66382592a047d288f85226f": "OKX 2",
  "0x7eb6c83ab7d8d9b8618c0ed973cbef71d1921ef2": "OKX 3",
  "0xA7EFae728D2936e78BDA97dc267687568dD593f3": "OKX 4",
  "0x2faf487A4414Fe77e2327F0bf4AE2a264a776AD2": "FTX",
  "0xC098B2a3Aa256D2140208C3de6543aAEf5cd3A94": "FTX 2",
  "0x25eaff5b179f209cf186b1cdcbfa463a69df4c45": "FTX 3",
  "0x7abe0ce388281d2acf297cb089caef3819b13448": "FTX 4",
  "0x1b3cb81e51011b549d78bf720b0d924ac763a7c2": "Bybit",
  "0x1b5b4e441f16a93837710f6405359c1b1a67715d": "Bybit 2",
  "0x7155d7a4e4a8a0e9a793bfb3f2b2c0b1026a78b9": "Bybit 3",
  "0xee5b5b923ffce93a870b3104b7ca09c3db80047a": "Bybit 4",
  "0xf89d7b9c864f589bbF53a82105107622B35EaA40": "Bybit 5",
  // Adrese Binance Smart Chain
  "0x8894E0a0c962CB723c1976a4421c95949bE2D4E3": "Binance BSC",
  "0xBE0eB53F46cd790Cd13851d5EFf43D12404d33E8": "Binance BSC 2",
  "0x5a52E96BAcdaBb82fd05763E25335261B270Efcb": "Binance BSC 3",
};

const WhaleTransactions = () => {
  const [transactions, setTransactions] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchWhaleTransactions = async () => {
      const API_KEY_ETH = "RP1AAGBP2YNUWFTAFP6KWT7GRRKC5BG5MM"; // Înlocuiește cu cheia ta Etherscan
      const API_KEY_BSC = "P51M4PQJ9KBGFGNXJFUETUJ2HSNJ98Y26T"; // Înlocuiește cu cheia ta BscScan

      const wallets = [
        {
          name: "Binance",
          address: "0x742d35Cc6634C0532925a3b844Bc454e4438f44e",
          blockchain: "ETH",
          apiKey: API_KEY_ETH,
        },
        {
          name: "Binance BSC",
          address: "0x8894E0a0c962CB723c1976a4421c95949bE2D4E3",
          blockchain: "BSC",
          apiKey: API_KEY_BSC,
        },
        // Adaugă mai multe adrese aici
      ];

      const allTransactions = [];

      for (let wallet of wallets) {
        const { address, blockchain, apiKey, name } = wallet;
        const url =
          blockchain === "ETH"
            ? `https://api.etherscan.io/api?module=account&action=txlist&address=${address}&startblock=0&endblock=99999999&page=1&offset=10&sort=desc&apikey=${apiKey}`
            : `https://api.bscscan.com/api?module=account&action=txlist&address=${address}&startblock=0&endblock=99999999&page=1&offset=10&sort=desc&apikey=${apiKey}`;

        try {
          const response = await fetch(url);
          const data = await response.json();
          console.log(data);

          if (data.status === "1") {
            const filteredTransactions = data.result.filter(
              (tx) => parseFloat(tx.value) > 10 ** 18 * 100 // Filtrează tranzacții mai mari de 100 ETH/BNB
            );

            const transactionsWithData = filteredTransactions.map((tx) => {
              let exchange = "Unknown";

              // Verifică atât 'from', cât și 'to'
              if (whaleWallets[tx.from]) {
                exchange = whaleWallets[tx.from];
              } else if (whaleWallets[tx.to]) {
                exchange = whaleWallets[tx.to];
              }

              return {
                hash: tx.hash,
                from: tx.from,
                to: tx.to,
                value: tx.value / 10 ** 18,
                blockchain,
                exchange,
                date: new Date(tx.timeStamp * 1000).toLocaleString(),
                fee: tx.gasUsed ? (tx.gasUsed * tx.gasPrice) / 10 ** 18 : "N/A",
                block: tx.blockNumber,
                age: formatDistanceToNow(new Date(tx.timeStamp * 1000)),
                icon:
                  blockchain === "ETH" ? (
                    <FaEthereum className="text-cyan-400 text-xl" />
                  ) : (
                    <FaBitcoin className="text-yellow-400 text-xl" />
                  ),
              };
            });

            allTransactions.push(...transactionsWithData);
          } else {
            console.error(`No transactions found for wallet: ${name}`);
          }
        } catch (error) {
          console.error("Error fetching transactions:", error);
        }
      }

      // Sortează tranzacțiile după valoare (descrescător)
      allTransactions.sort((a, b) => b.value - a.value);

      setTransactions(allTransactions.slice(0, 20)); // Limitează la primele 20 tranzacții
      setLoading(false);
    };

    fetchWhaleTransactions();
  }, []);

  const truncate = (str) => {
    return str.length > 15 ? `${str.slice(0, 6)}...${str.slice(-4)}` : str;
  };

  return (
    <div className="container mx-auto p-6">
      <h2 className="text-3xl font-bold text-center mb-8 text-transparent bg-clip-text bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500 dark:text-transparent dark:bg-clip-text dark:bg-gradient-to-r dark:from-teal-300 dark:to-green-400">
        Whale Transactions
      </h2>
      {loading ? (
        <p className="text-center text-xl text-gray-600">
          Loading transactions...
        </p>
      ) : (
        <div className="bg-white rounded-lg shadow-lg p-6">
          {transactions.length > 0 ? (
            <div className="space-y-4">
              {transactions.map((tx, index) => (
                <div key={index} className="p-4 border-b border-gray-300">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-4">
                      <div className="w-12 h-12 bg-indigo-100 rounded-full flex justify-center items-center">
                        {tx.icon}
                      </div>
                      <div>
                        <div className="font-semibold text-lg text-gray-800">
                          {tx.exchange} Transaction
                        </div>
                        <div className="text-sm text-gray-500">
                          {tx.age} ago
                        </div>
                      </div>
                    </div>
                    <div>
                      <a
                        href={`https://${
                          tx.blockchain === "ETH"
                            ? "etherscan.io"
                            : "bscscan.com"
                        }/tx/${tx.hash}`}
                        className="text-cyan-500"
                        target="_blank"
                        rel="noopener noreferrer"
                      >
                        View on{" "}
                        {tx.blockchain === "ETH" ? "Etherscan" : "BscScan"}
                      </a>
                    </div>
                  </div>
                  <div className="mt-4 grid grid-cols-3 gap-6">
                    <div>
                      <strong>From:</strong>{" "}
                      <a
                        href={`https://${
                          tx.blockchain === "ETH"
                            ? "etherscan.io"
                            : "bscscan.com"
                        }/address/${tx.from}`}
                        className="text-cyan-500"
                        target="_blank"
                        rel="noopener noreferrer"
                      >
                        {truncate(tx.from)}
                      </a>
                    </div>
                    <div>
                      <strong>To:</strong>{" "}
                      <a
                        href={`https://${
                          tx.blockchain === "ETH"
                            ? "etherscan.io"
                            : "bscscan.com"
                        }/address/${tx.to}`}
                        className="text-cyan-500"
                        target="_blank"
                        rel="noopener noreferrer"
                      >
                        {truncate(tx.to)}
                      </a>
                    </div>
                    <div>
                      <strong>Amount:</strong> {tx.value}{" "}
                      {tx.blockchain === "ETH" ? "ETH" : "BNB"}
                    </div>
                    <div>
                      <strong>Block:</strong> {tx.block}
                    </div>
                    <div>
                      <strong>Fee:</strong> {tx.fee}{" "}
                      {tx.blockchain === "ETH" ? "ETH" : "BNB"}
                    </div>
                    <div>
                      <strong>Transaction Hash:</strong>{" "}
                      <a
                        href={`https://${
                          tx.blockchain === "ETH"
                            ? "etherscan.io"
                            : "bscscan.com"
                        }/tx/${tx.hash}`}
                        className="text-cyan-500"
                        target="_blank"
                        rel="noopener noreferrer"
                      >
                        {truncate(tx.hash)}
                      </a>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          ) : (
            <p className="text-center text-xl text-gray-600">
              No large transactions available at the moment.
            </p>
          )}
        </div>
      )}
    </div>
  );
};

export default WhaleTransactions;
